export default function Header({ loggedIn }) {
  return(
    <header className="header">
      <img
        src={logo}
        className="header__logo"
        alt="Логотип проекта"
      />
      <div>
        <span className='header__mail'>{loggedIn ? 'опро' : 'Loh'}</span>
        <a href='#' className="header__auth-button">Выйти</a>
      </div>
    </header>
  )
}
